import React from "react";
import Category from "./Category";
import TopSelling from "./TopSelling";
import New from "./New";
export default function index() {
  return (
    <div style={{ marginleft:'100', paddingTop: "100px" }}>
      <div>
        <table style={{marginLeft:'auto', marginRight:'auto'}}>
          <tr>
            <TopSelling />
          </tr>
          <tr>
            <New />
          </tr>
          <tr>
            <Category />
          </tr>
        </table>
      </div>
    </div>
  );
}
